// src/Home.js
import React, { useEffect } from 'react';

function Home({ visits, setVisits }) {
  useEffect(() => {
    setVisits(visits + 1);
  }, [setVisits, visits]);

  return (
    <div>
      <h1>Home Page</h1>
      <p>Welcome to the Home Page</p>
      <p>Your Banner ID: B00921886</p>
    </div>
  );
}

export default Home;
